import React from "react";
import { Todo } from "../model";

type Props = {
  todo: Todo,
  todos: Todo[],
  setTodos: React.Dispatch<React.SetStateAction<Todo[]>>,
};

const SingleTodo = ({ todo, todos, setTodos }) => {
  return <div>single todo</div>;
};

export default SingleTodo;
